import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const SkillScreen = () => {
  return (
    <View>
      <Text>SkillScreen</Text>
    </View>
  )
}

export default SkillScreen

const styles = StyleSheet.create({})
